import * as t from "react";
import a from "../lib/IconBase.es.js";
import f from "../defs/Butterfly.es.js";
const e = t.forwardRef((o, r) => /* @__PURE__ */ t.createElement(a, { ref: r, ...o, weights: f }));
e.displayName = "ButterflyIcon";
const s = e;
export {
  s as Butterfly,
  e as ButterflyIcon
};
